	private void test(Random r, int count, Path path) throws IOException {
		System.out.println("count: "+count);
		
		List<Meta> expected;
		if(count == 0 )
			expected = Collections.emptyList();
		else {
			Meta[] metas = new Meta[count];
			for (int i = 0; i < metas.length; i++)
				metas[i] = new Meta(r.nextInt(), r.nextLong(), paths.get(r.nextInt(paths.size())));
			
			expected = Arrays.asList(metas);
		}
		
		MetaHelper.write(expected, path);
		ArrayList<Meta> actual = new ArrayList<>();
		MetaHelper.read(actual, path);
		
		assertEquals(expected.size(), actual.size());
		
		for (int i = 0; i < actual.size(); i++) {
			Meta e = expected.get(i);
			Meta a = actual.get(i);
			
			assertNotSame(e, a);
			assertEquals(e.id, a.id);
			assertEquals(e.lastModified(), a.lastModified());
			assertEquals(e.path(), a.path());
		}
	}

